import React from "react";
import { Button, Box, TextField, Stack } from "@mui/material";
import "./index.css";

function Login() {
  return (
     <Stack spacing={4} alignContent="center" justifyContent="center" alignItems="center">
          <TextField
            fullWidth
            id="outlined-basic"
            label="Username"
            variant="outlined"
          />
          <TextField
            fullWidth
            id="outlined-password-input"
            label="Password"
            type="password"
          />
          <Button fullWidth variant="contained">
            Login
          </Button>
    </Stack>
  );
}

export default Login;
